Patch Set 1:

NV package is the first major package we see major divergence between AR and WP/EM. Maybe we should take a step back and take a look at these differences first.

Currently these are marked with FEATURE_SIERRA_MEMORY_RELIABILITY. First of all all product need reliability in terms of NV. I see the following problem in the current code being pushed for review (or in current projects):
- new functions for _RELIABILITY, are these really needed and why other products are not using it?
- extra inputs for the same function if _RELIABILITY, which make code really hard to read and maintain.

I understand that when we added these _RELIABILITY changes we were in a rush and now it might be a good time to understand and unify these differences.

Examples:

#ifdef FEATURE_SIERRA_MEMORY_RELIABILITY
extern boolean nv_up_delete_process(void);
extern boolean nv_up_program_process(nv_up_prog_t *proginfo, uint32_t *prog_result);
extern boolean nv_up_apply_process(uint32_t *apply_result);
extern void    nv_efsautobackup_init(void);
extern boolean nv_backup_part_to_file_sync(enum nv_backup_point_e point, char *path_in_cwe);
extern boolean nv_revert(enum nv_backup_point_e point_in, const int *exceptions, nvstats_t *stats);
#else /* !FEATURE_SIERRA_MEMORY_RELIABILITY */
extern boolean nv_backup_part_to_file_sync(enum nv_backup_point_e  point);
extern boolean nv_revert(enum nv_backup_point_e point, const int *exceptions, nvstats_t *stats);
#endif /* FEATURE_SIERRA_MEMORY_RELIABILITY */

Trailing whitespace throughout (When I don't forget, I use:
sed -i 's/[ \t]*$//' <file>
)

I saw these 2 variables are declared as "extend" variable. This is not a good programming practice. I recommend to add the below 2 APIs:

_package void sp_lock(void)
{
  SWI_ASSERT(sp_initialized);
  os_mutex_lock(&sp_mutex);
}

_package void sp_unlock(void)
{
  SWI_ASSERT(sp_initialized);
  os_mutex_unlock(&sp_mutex);
}

The declaration of these 2 functions can be added to spintcmn.h.

As we discussed offline, please check if singleton/double check lock is able to be used here to optimize the design. The advantage is the first client using the service is responsibie for sp initialization. The disadvantage is the implementation may be a little bit complicate.

moreover even for the current solution, I recommend:
void sp_init(void)

{
  if (!sp_initialized)
  {
    os_mutex_init(&sp_mutex);
    sp_initialized = TRUE;
  }
}

I think the below implementation could be more accurate the reveal the intention of the initialization even the effect is the same:
_global void sp_init(void)

{
  if(!sp_initialized)
  {
    os_mutex_init(&sp_mutex);
    sp_initialized = TRUE;
  }
}
